import React from "react";
import { AwesomeButton } from "react-awesome-button";
import 'react-awesome-button/dist/themes/theme-one.css';
import InfoIcon from "@material-ui/icons/Info";
import SchoolIcon from "@material-ui/icons/School";
import WorkIcon from "@material-ui/icons/Work";
import ProjectsIcon from "@material-ui/icons/GitHub";
import SkillsIcon from "@material-ui/icons/LocalActivity";
import styled from "styled-components";

export default function AddField() {
    var buttons = [{icon:<InfoIcon/>},{icon:<SchoolIcon/>}, {icon:<WorkIcon/>},{icon:<ProjectsIcon/>},{icon:<SkillsIcon/>}]
    return (
      <OuterDiv>
        <InnerDiv>
        <ButtonDiv>
        {buttons.map((item) => (
            <AwesomeButton style={{margin:'5px', }} type="primary">{item.icon}</AwesomeButton>
        ))}
        </ButtonDiv>
        </InnerDiv>
     </OuterDiv>
    )
};


const OuterDiv = styled.div`
  background-color: green;
  height: 100vh;
  width: 50%;
  margin: auto;
  position: relative;
`;

const InnerDiv = styled.div`
  background-color: blue;
  height: 15%;
`;

const ButtonDiv = styled.div`
  background-color: pink;
  height: 100%;
`;
